// ============================================================================
// Mozek Icons Registry
// ============================================================================
// This file exports the master registry for all icons used in the
// Mozek Design System. It serves as the central source of truth for
// icon metadata, names, and SVG references.
//
// Purpose:
// To provide a unified interface for retrieving, displaying, and managing
// icons throughout the Mozek ecosystem. The registry ensures consistency
// across UI components (e.g., <moz-icon>), documentation, and theming.
//
// Structure:
// - Import Section: SVG or JSON icon assets (inline or via URL).
// - Icon Map: A key–value object linking icon names to their SVG path data.
// - Exported Interface: mozekIcon and mozekIconList types for type safety.
// - Default Export: The full icon registry (mozekIcons).
//
// Design Philosophy:
// Centralizing icon definitions allows consistent naming conventions,
// theme-aware color adaptation, and lightweight builds (tree-shakable).
// Each icon follows the Mozek grid standard (24 × 24 px) and uses
// currentColor for dynamic coloring.
//
// Example:
//   import { mozekIcons } from './mozek-icons';
//
//   const homeIcon = mozekIcons['home'];
//
//   <moz-icon [svg]="homeIcon"></moz-icon>
//
// Example Structure:
//   export interface mozekIcon {
//     name: string;
//     svg: string;
//   }
//
//   export const mozekIcons: Record<string, mozekIcon> = {
//     home: { name: 'home', svg: '<svg ...></svg>' },
//     alert: { name: 'alert', svg: '<svg ...></svg>' },
//     check: { name: 'check', svg: '<svg ...></svg>' },
//   };
//
// Notes:
// - All icons should align to a 24 px grid.
// - Use stroke="currentColor" and fill="none" for color inheritance.
// - Keep names kebab-case (e.g., 'alert-circle', 'user-check').
// - The registry can be extended dynamically or tree-shaken by build tools.
//
// -----------------------------------------------------------------------------
// Author: thecodemeor
// Version: 1.0
// -----------------------------------------------------------------------------


